INSERT INTO `movies` VALUES (1,1,'The Salton Sea ','English','After the murder of his beloved wife, a man in search of redemption is set adrift in a world where nothing is as it seems. On his journey, he befriends slacker Jimmy \\\"The Finn\\\", becomes involved in rescuing his neighbor Colette from her own demons, and gets entangled in a web of deceit full of unexpected twists and turns.',12.3,'https://image.tmdb.org/t/p/original/i3InMSlLUNBEdQTKazMdyVP1ryX.jpg','https://image.tmdb.org/t/p/original/keHN5s88wrPD3C07n6Lzev0vd69.jpg','2022/02/02',6.6,286,0,'2025-03-26 21:06:14','2025-04-12 18:48:29'),(2,2,'Queenpins','English','Bored and frustrated suburban homemaker Connie and her best pal JoJo, a vlogger with dreams, turn a hobby into a multi-million-dollar counterfeit coupon caper. After firing off a letter to the conglomerate behind a box of cereal gone stale, and receiving an apology along with dozens of freebies, the duo hatch an illegal coupon club scheme that scams millions from mega-corporations and delivers deals to legions of fellow coupon clippers. On the trail to total coupon dominance, a hapless Loss Prevention Officer from the local supermarket chain joins forces with a determined U.S. Postal Inspector in hot pursuit of these newly minted “Queenpins” of pink collar crime.',6,'https://image.tmdb.org/t/p/original/p3MqxGqMdq4eqzWN6H7ugEdYv1W.jpg','https://image.tmdb.org/t/p/original/55uYpBNnlsUE9fCb3Eibx7F4zps.jpg','2025/02/02',5,147,0,'2025-03-28 11:10:18','2025-04-12 08:56:27'),(3,3,'Lethal Weapon','English','In the opening chase, Martin Riggs and Roger Murtaugh stumble across a trunk full of Krugerrands. They follow the trail to a South African diplomat who\'s using his immunity to conceal a smuggling operation. When he plants a bomb under Murtaugh\'s toilet, the action explodes!',6,'https://image.tmdb.org/t/p/original/1EEIUw0tkX7AJZ1ikZrtKZZKlC6.jpg','https://image.tmdb.org/t/p/original/zjRkl5PZvFujbRndrNbf4ZKbeNC.jpg','2025/02/02',2,150,0,'2025-03-28 11:11:08','2025-04-12 09:42:46'),(4,4,'Scooby-Doo','English','The mystery begins when Shaggy and Scooby win tickets to \\\"WrestleMania\\\" and convince the crew to go with them to WWE City. But this city harbors a spooky secret - a ghastly Ghost Bear holds the town in his terrifying grip! To protect the coveted WWE Championship Title, the gang gets help from WWE Superstars like John Cena, Triple H, Sin Cara, Brodus Clay, AJ Lee, The Miz and Kane. Watch Scooby and the gang grapple with solving this case before it\'s too late.',3,'https://image.tmdb.org/t/p/original/vR8BBTRxU2xu0FvrTTio8CvCwi3.jpg','https://image.tmdb.org/t/p/original/opwf2L7m9MXGyFkiQndRDGdx7n2.jpg','2025/02/02',7,120,0,'2025-03-28 11:12:19','2025-04-12 09:42:46'),(5,5,'Avengers','English','An upcoming film in the Marvel Cinematic Universe\'s sixth Phase and part of The Multiverse Saga. Plot unknown.',3,'https://image.tmdb.org/t/p/original/utZTb3VBrH0zR77BcISU67pHuAx.jpg','https://image.tmdb.org/t/p/original/uR952NrgispGuyqIdUbkR24vE0u.jpg','2025/02/02',8,150,0,'2025-03-28 14:38:46','2025-04-12 09:42:46'),(6,6,'the Gun','English','Two criminal drifters without sympathy get more than they bargained for after kidnapping and holding for ransom the surrogate mother of a powerful and shady man.',6,'https://image.tmdb.org/t/p/original/wrjMMdgn1a4ChlaBmlzKnb78nr6.jpg','https://image.tmdb.org/t/p/original/pW9GDWAlOwHjLrNbar442etuw0m.jpg','2022/02/02',9,150,0,'2025-03-28 14:39:07','2025-04-12 09:42:46'),(7,7,'Escape','English','San Francisco Bay, January 18, 1960. Frank Lee Morris is transferred to Alcatraz, a maximum security prison located on a rocky island. Although no one has ever managed to escape from there, Frank and other inmates begin to carefully prepare an escape plan.',3,'https://image.tmdb.org/t/p/original/uORr2GXQnyqgBOg6tVsRCJD2qxc.jpg','https://image.tmdb.org/t/p/original/1JmJFRgYdQc8v0PsGVARCjbGHdf.jpg','2025/02/02',3,120,0,'2025-03-28 14:40:04','2025-04-12 09:42:46'),(8,8,'Kangaroo Jack','English','Two childhood friends — a New York hairstylist and a wanna-be musician — get mixed-up with the mob and are forced to deliver $50,000 to Australia, but things go all wrong when the money is lost to a wild kangaroo.',4,'https://image.tmdb.org/t/p/original/nflh9On0de4l7ItCl3n4NVXjmnm.jpg','https://image.tmdb.org/t/p/original/eFOETcLUrOLUd10e7Hzrr6Ek8ya.jpg','2024/02/02',8,150,0,'2025-03-28 14:40:26','2025-04-12 09:42:46'),(9,9,'Impulse','English','Acting on impulse, Claire Dennison (Willa Ford), enjoys a brief fling with a sexy stranger (a dead ringer for her husband), only to realize that the object of her desire is a crazed, manipulative, and tenacious psychopath.',2,'https://image.tmdb.org/t/p/original/8EVCWonAyI7fQH4DZhJyd60iDyW.jpg','https://image.tmdb.org/t/p/original/h6mhnsabIBd7276jQBsWwz0UsoU.jpg','2022/02/02',6,150,0,'2025-03-28 14:40:45','2025-04-12 09:42:46'),(10,10,'Gulliver\'s Travels','English','Gulliver washes ashore on Lilliput and attempts to prevent war between that tiny kingdom and its equally-miniscule rival, Blefiscu, as well as smooth the way for the romance between the Princess and Prince of the opposing lands. In this he is alternately aided and hampered by the Lilliputian town crier and general fussbudget, Gabby. A life-threatening situation develops when the bumbling trio of Blefiscu spies, Sneak, Snoop, and Snitch, manage to steal Gulliver\'s pistol.',4,'https://image.tmdb.org/t/p/original/oxJuUeTOaAunEJJ64F2ua0Q3XSz.jpg','https://image.tmdb.org/t/p/original/pwP9RTomD5Ft6fQYLmkUTUlKTgv.jpg','2000/02/02',1,120,0,'2025-03-28 14:41:15','2025-04-12 09:42:46'),(11,11,'Black Cauldron','English','Taran is an assistant pigkeeper with boyish dreams of becoming a great warrior. However, he has to put the daydreaming aside when his charge, an oracular pig named Hen Wen, is kidnapped by an evil lord known as the Horned King. The villain hopes Hen will show him the way to The Black Cauldron, which has the power to create a giant army of unstoppable soldiers.',3,'https://image.tmdb.org/t/p/original/act8vtlXVEizdsUf9FcKbzSERew.jpg','https://image.tmdb.org/t/p/original/1iJmfr3TkB6Q2xHD4qMhUkF9dQv.jpg','2010/02/02',1,120,0,'2025-03-28 14:41:30','2025-04-12 09:42:46'),(12,12,'Dead Ahead','English','Bored and frustrated suburban homemaker Connie and her best pal JoJo, a vlogger with dreams, turn a hobby into a multi-million-dollar counterfeit coupon caper. After firing off a letter to the conglomerate behind a box of cereal gone stale, and receiving an apology along with dozens of freebies, the duo hatch an illegal coupon club scheme that scams millions from mega-corporations and delivers deals to legions of fellow coupon clippers. On the trail to total coupon dominance, a hapless Loss Prevention Officer from the local supermarket chain joins forces with a determined U.S. Postal Inspector in hot pursuit of these newly minted “Queenpins” of pink collar crime.',4,'https://image.tmdb.org/t/p/original/66HBVfCkhevEpPV2fMzt8FAF9BP.jpg','https://image.tmdb.org/t/p/original/t9cr4ly87MV8eQBldbiWNNNm8iB.jpg','2023/02/02',3,120,0,'2025-03-28 14:41:53','2025-04-12 09:42:46'),(13,13,'Shaggy Dog','English','In the opening chase, Martin Riggs and Roger Murtaugh stumble across a trunk full of Krugerrands. They follow the trail to a South African diplomat who\'s using his immunity to conceal a smuggling operation. When he plants a bomb under Murtaugh\'s toilet, the action explodes!',2,'https://image.tmdb.org/t/p/original/tGX3YyPaYMbjiRwR5PjRsJW7GtM.jpg','https://image.tmdb.org/t/p/original/veUujxONO3SyAvfZp5QndqPSzLg.jpg','2022/02/02',3,130,0,'2025-03-28 14:43:25','2025-04-12 09:42:46'),(14,14,'Barbie Video','English','An upcoming film in the Marvel Cinematic Universe\'s sixth Phase and part of The Multiverse Saga. Plot unknown.',3,'https://image.tmdb.org/t/p/original/rWQPf9Q8CAHIpBP8SVLE3uaSmf4.jpg','https://image.tmdb.org/t/p/original/b4GZGBx90XXbkI8yr4Pq2uf2XyP.jpg','2022/02/02',4,100,0,'2025-03-28 14:44:03','2025-04-12 09:42:46'),(15,15,'The Adults','English','After the murder of his beloved wife, a man in search of redemption is set adrift in a world where nothing is as it seems. On his journey, he befriends slacker Jimmy \\\"The Finn\\\", becomes involved in rescuing his neighbor Colette from her own demons, and gets entangled in a web of deceit full of unexpected twists and turns.',3,'https://image.tmdb.org/t/p/original/iA8HDbXgQE6RIEwqCMBZwPbpfxT.jpg','https://image.tmdb.org/t/p/original/nVP2UAvA9pH7h3pkkKryyMc3cGl.jpg','2020/02/02',8,100,0,'2025-03-28 14:44:41','2025-04-12 09:42:46'),(16,16,'The Phantom','English','San Francisco Bay, January 18, 1960. Frank Lee Morris is transferred to Alcatraz, a maximum security prison located on a rocky island. Although no one has ever managed to escape from there, Frank and other inmates begin to carefully prepare an escape plan.',2,'https://image.tmdb.org/t/p/original/1vf1ryVPBSV2J8dOfCmyv3u0Vu4.jpg','https://image.tmdb.org/t/p/original/hjmKqTwOIwN52RBGM72bLSq9Gay.jpg','2000/02/02',1,120,0,'2025-03-28 14:46:36','2025-04-12 09:42:46'),(17,17,'Sling Blade','English','',2,'https://image.tmdb.org/t/p/original/y7kYNk6gJMkPx1YfXhXw6fMTstf.jpg','https://image.tmdb.org/t/p/original/s0MYaSiEZy9H0cXxxay5LEdcxYs.jpg','2020/02/02',1,130,0,'2025-03-28 14:47:15','2025-04-12 09:42:46'),(18,18,'Metal Lords','English','',2,'https://image.tmdb.org/t/p/original/r97txZRmBb75SGsIAWqmplWJnO3.jpg','https://image.tmdb.org/t/p/original/gc3QFVNWeTCk2J7XuDIPPoGUWNx.jpg','2022/02/02',2,100,0,'2025-03-28 14:52:57','2025-04-12 09:42:46'),(19,19,'The Road','English','New York hairstylist and a wanna-be musician — get mixed-up with the mob and are forced to deliver $50,000 to Australia, but things go all wrong when the money is lost to a wild kangaroo.',2,'https://image.tmdb.org/t/p/original/qLaXnLzqleBWQtjvZ6JGVSaKoC3.jpg','https://image.tmdb.org/t/p/original/6188iOmUAitGThYUjyx20fO4LJd.jpg','2023/02/02',3,120,0,'2025-03-28 14:57:05','2025-04-12 09:42:46'),(20,20,'Triple T